n which an eligible list is made available for certification to agencies to consider an eligible candidate for appointment.\\n\",\n                \"The date on which a list will be extended beyond its original expiration date.  \\n\",\n                \"A candidate’s last name as it appears on their application.\\n\",\n                \"Represents the certification order for a list. (e.g. – eligible candidates on a list with a 01 group number may be considered for appointment before an eligible candidate on primary list with a 00 group number).\\n\",\n                \"A four (4) digit number that identifies a civil service examination. \\n\\n\",\n                \"A descriptive name that identifies a civil service title. \\n\",\n                \"The date on which an eligible list is scheduled to expire.      \\n\",\n                \"A five (5) digit number that corresponds to and represents a civil service title.\\n\",\n                \"The promotional division codes/descriptions within the New York City Transit Authority only.\\n\",\n                \"A three (3) digit number used to identify an agency (For Promotion List Only).\\n\",\n                \"An additional credit given to a Veteran (5 points) or disabled veteran (10 points) when s/he accepts a permanent position from an eligible list. \\n\",\n                \"A “Parent Legacy credit” is an additional credit given on an exam (10 points) to a candidate who lost a parent (FDNY, NYPD, or a First Responder, during or as a result of 911).\\n\",\n                \"The Adjusted Final Average (“Adj. FA” or “AFA”) is an eligible candidate’s test score in addition to any additional credits granted.\\n\"\n              ],\n            \"columns_format\" :\n              [\n                { \"displayStyle\" : \"plain\", \"align\" : \"left\" },\n                { \"displayStyle\" : \"plain\", \"align\" : \"left\" },\n                { \"displayStyle\" : \"plain\", \"align\" : \"left\" },\n                {\n   